#include <iostream>
#include <windows.h>
#include <vector>
#include <chrono>
#include "sort_algorithms.h"

void measureSortTime(void (*sortFunc)(std::vector<int>&, int, int), std::vector<int>& data) {
    auto start = std::chrono::high_resolution_clock::now();
    sortFunc(data, 0, data.size() - 1);
    auto stop = std::chrono::high_resolution_clock::now();
    auto duration = std::chrono::duration_cast<std::chrono::microseconds>(stop - start);
    std::cout << "Час виконання: " << duration.count() << " мікросекунд" << std::endl;
}

std::vector<int> RandomVector(int size) {
    std::vector<int> vec(size);
    for (int i = 0; i < size; i++) {
        vec[i] = std::rand() % 10001;
    }
    return vec;
}

int main() {
    SetConsoleCP(1251);
    SetConsoleOutputCP(1251);
    std::srand(unsigned int(std::time(0)));
    std::vector<int> sizes = { 50, 500, 5000, 50000, };
    for (int i = 0; i < sizes.size(); i++) {
        int size = sizes[i];
        std::cout << std::endl << "Розмір вектора: " << size << " елементів" << std::endl;
        std::vector<int> originalData = RandomVector(size);
        std::vector<int> data = originalData;
        std::cout << "QuickSort: ";
        measureSortTime(quickSort, data);
        data = originalData;
        std::cout << "MergeSort: ";
        measureSortTime(mergeSort, data);
        data = originalData;
        std::cout << "BubbleSort: ";
        measureSortTime(bubbleSort, data);
        data = originalData;
        std::cout << "InsertionSort: ";
        measureSortTime(insertionSort, data);
        data = originalData;
        std::cout << "SelectionSort: ";
        measureSortTime(selectionSort, data);
    }
}

#ifndef SORT_ALGORITHMS_H
#define SORT_ALGORITHMS_H

#include <vector>
#include <algorithm>

// QUICK SORT
int partition(std::vector<int>& arr, int low, int high) {
    int pivot = arr[high];
    int i = low - 1;
    for (int j = low; j < high; j++) {
        if (arr[j] < pivot) {
            i++;
            std::swap(arr[i], arr[j]);
        }
    }
    std::swap(arr[i + 1], arr[high]);
    return i + 1;
}

void quickSort(std::vector<int>& arr, int low, int high) {
    if (low < high) {
        int pi = partition(arr, low, high);
        quickSort(arr, low, pi - 1);
        quickSort(arr, pi + 1, high);
    }
}

// MERGE SORT
void merge(std::vector<int>& arr, int left, int mid, int right) {
    std::vector<int> leftPart(arr.begin() + left, arr.begin() + mid + 1);
    std::vector<int> rightPart(arr.begin() + mid + 1, arr.begin() + right + 1);

    int i = 0, j = 0, k = left;
    while (i < leftPart.size() && j < rightPart.size()) {
        if (leftPart[i] <= rightPart[j]) {
            arr[k++] = leftPart[i++];
        }
        else {
            arr[k++] = rightPart[j++];
        }
    }
    while (i < leftPart.size()) arr[k++] = leftPart[i++];
    while (j < rightPart.size()) arr[k++] = rightPart[j++];
}

void mergeSort(std::vector<int>& arr, int left, int right) {
    if (left < right) {
        int mid = (left + right) / 2;
        mergeSort(arr, left, mid);
        mergeSort(arr, mid + 1, right);
        merge(arr, left, mid, right);
    }
}

// BUBBLE SORT
void bubbleSort(std::vector<int>& arr, int low, int high) {
    for (int i = low; i < high; ++i) {
        for (int j = low; j < high - (i - low) - 1; ++j) {
            if (arr[j] > arr[j + 1]) {
                std::swap(arr[j], arr[j + 1]);
            }
        }
    }
}

// INSERTION SORT
void insertionSort(std::vector<int>& arr, int low, int high) {
    for (int i = low + 1; i <= high; ++i) {
        int key = arr[i];
        int j = i - 1;
        while (j >= low && arr[j] > key) {
            arr[j + 1] = arr[j];
            j--;
        }
        arr[j + 1] = key;
    }
}

// SELECTION SORT
void selectionSort(std::vector<int>& arr, int low, int high) {
    for (int i = low; i < high; ++i) {
        int minIndex = i;
        for (int j = i + 1; j <= high; ++j) {
            if (arr[j] < arr[minIndex]) {
                minIndex = j;
            }
        }
        std::swap(arr[i], arr[minIndex]);
    }
}

#endif // SORT_ALGORITHMS_H
